        console.log(response);
    };
    const errorMessage = (error) => {
        console.log(error);
    };
    return (

        <GoogleLogin onSuccess={responseMessage} onError={errorMessage}
        clien
            render= {<button >This is my custom Google button</button>}
            icon={false}

            

        />

    )
}


export default Login;
